  \    \"SN_INDUSTRYSEGMENT\" as \"SN_INDUSTRYSEGMENT\",\n             \"SN_INDUSTRYSEGMENTNAME\"\
  \ as \"SN_INDUSTRYSEGMENTNAME\",\n             \"SN_ACCOUNTMAINTENANCENAME\" as\
